        // ee = (a^2 - b^2) / a^2;
        var a = 6378245.0; //  a: 卫星椭球坐标投影到平面地图坐标系的投影因子。

        var sqrtMagic = Math.sqrt(magic);
        dLat = (dLat * 180.0) / ((a * (1 - ee)) / (magic * sqrtMagic) * this.PI);
        dLon = (dLon * 180.0) / (a / sqrtMagic * Math.cos(radLat) * this.PI);
        return { 'lat': dLat, 'lon': dLon };

        var pLat = gcjLat + dLat, pLon = gcjLon + dLon;

         points.push(new BMap.Point(BDlng[i],BDlat[i]));
     }
    //地图初始化
    var bm = new BMap.Map("allmap");
    bm.centerAndZoom(new BMap.Point(115.944523,28.651165), 15);
    var polyline=new BMap.Polyline(points, {
                enableEditing: false,//是否启用线编辑，默认为false
                enableClicking: false,//是否响应点击事件，默认为true
                strokeWeight:'3',//折线的宽度，以像素为单位
                strokeOpacity: 0.4,//折线的透明度，取值范围0 - 1
                strokeColor:"black" //折线颜色
                });
    bm.addOverlay(polyline);
    var marker = new BMap.Marker(new BMap.Point(BDlng[0],BDlat[0]));  // 创建标注
    bm.addOverlay(marker);
    var marker = new BMap.Marker(new BMap.Point(BDlng[num-1],BDlat[num-1]));  // 创建标注
    bm.addOverlay(marker);
</script>
